import React, {Component} from "react"
import cv from "../../assets/cv.jpg"

class ResumePage extends Component{
    constructor(props) {
        super(props);
        this.props.history.push('/');
        this.props.history.push(this.props.match.url);
    }

    render() {
        return (
            <div>
                <Document
                    file={cv}>
                    <Page
                        pageNumber={1}/>
                </Document>
            </div>
        );
    }
}

export default ResumePage;
